INSERT INTO `plant` VALUES (1,'Rose','Rosa rubiginosa',NULL,1,1,1),(7,'Sunflower','Helianthus annuus','Sunflowers are annual plants with large flower heads (capitula) that can be up to 30 cm in diameter.  They are known for their large, daisy-like flowers with bright yellow ray florets surrounding a dark brown central disk.  The plant produces seeds which are rich in oil and are commonly used as a food source. People with pollen allergies or sensitivities should avoid sunflowers as their pollen can be a significant allergen.',0,0,0),(8,'Daisy','Bellis perennis','The common daisy is a small, herbaceous flowering plant in the family Asteraceae.  It features a low-growing rosette of spoon-shaped leaves and characteristic white or pink ray florets surrounding a yellow disc floret. People with pollen allergies or sensitivities should avoid it, as daisy pollen can be a common allergen.',0,0,0),(9,'Lavender','Lavandula angustifolia','Lavender is a genus of about 47 known species of flowering plants in the mint family, Lamiaceae.  They are known for their fragrant flowers and are commonly used in perfumes, aromatherapy, and culinary applications.  People with pollen allergies or sensitivities should avoid contact, as lavender pollen can be a trigger.',0,0,0),(10,'Peony','Paeonia spp.','Peonies are flowering plants known for their large, showy blooms.  They are popular garden ornamentals, coming in a variety of colors and forms.  People with pollen allergies or sensitivities should avoid them, as peony pollen can be a significant allergen for some individuals.',0,0,0),(11,'Pine','Pinus spp.','Pines are evergreen coniferous resinous trees (or shrubs in some species) belonging to the genus Pinus.  They are characterized by needle-like leaves, cones, and often a pyramidal shape.  Many species are economically important for timber and other products. People with pollen allergies or sensitivities should avoid pines during pollen season.',0,0,0),(12,'Maple','Acer spp.','Maples are a genus of trees and shrubs belonging to the Sapindaceae family.  They are known for their characteristic palmate leaves, vibrant fall foliage (in many species), and the production of winged samaras (helicopter seeds).  Many maple species are popular ornamentals and sources of maple syrup.  People with pollen allergies or sensitivities should avoid maples during their pollen season, as they can be a significant allergen.',0,0,0),(13,'plant','','',0,0,0),(14,'Oak','Quercus spp.','Oaks are a genus of deciduous and evergreen trees and shrubs in the beech family, Fagaceae.  They are known for their acorns and characteristic lobed leaves.  Many species are long-lived and can grow to be very large. People with pollen allergies or sensitivities should avoid oak trees during their pollen season.',0,0,0),(15,'Tulip','Tulipa','Tulips are bulbous perennial plants in the lily family. They are known for their showy, cup-shaped flowers that come in a wide variety of colors and cultivars.  People with pollen allergies or sensitivities should avoid them, as tulip pollen can be a common allergen.',0,0,0),(16,'Aster','Aster spp.','Aster is a large genus of flowering plants in the family Asteraceae, commonly known as asters.  They are known for their daisy-like flowers with ray florets surrounding a central disk.  Many species are popular garden plants, blooming in late summer and autumn. People with pollen allergies or sensitivities should avoid asters, as their pollen can be a significant allergen.',0,0,0),(17,'Sycamore','Platanus occidentalis','Sycamore, also known as American Sycamore, is a large deciduous tree known for its mottled bark, which peels off in patches revealing a lighter inner bark.  It has broad, palmate leaves with three to five lobes.  People with pollen allergies or sensitivities should avoid it, as it produces a significant amount of pollen.',0,0,0),(18,'Hydrangea','Hydrangea spp.','Hydrangeas are a genus of shrubs and small trees with large, showy flower heads.  They are popular ornamental plants known for their vibrant flower colors, which can vary depending on soil pH.  People with pollen allergies or sensitivities should avoid them as hydrangea pollen can be a trigger for allergic reactions.',1,0,0),(19,'Pineapple','Ananas comosus','Pineapple is a tropical plant with a fruit that is widely cultivated.  The fruit grows on a terrestrial plant, developing from a cluster of flowers on a single stalk. The plant has spiny, sword-like leaves. People with pollen allergies or sensitivities may wish to avoid contact with the flowers.',0,0,0),(20,'Boys Over Flowers','There is no single plant definitively associated with the drama \\','',0,0,0),(21,'Orchid','Orchidaceae','Orchids are a diverse and widespread family of flowering plants, known for their often showy and intricate flowers.  They range in size from tiny to quite large, and grow in a variety of habitats, from rainforests to deserts. Some orchids are epiphytes (growing on other plants), while others are terrestrial.  People with pollen allergies or sensitivities should avoid orchids, as some species may cause allergic reactions.',0,0,0),(22,'Carnation','Dianthus caryophyllus','Carnations are herbaceous perennial plants in the pink family (Caryophyllaceae). They are known for their brightly colored, fringed flowers which are popular as cut flowers and in gardens.  People with pollen allergies or sensitivities should avoid them as they can trigger allergic reactions.',0,0,0),(23,'Potato','Solanum tuberosum','The potato is a starchy tuberous crop from the nightshade family.  It is widely cultivated worldwide as a staple food.  People with pollen allergies or sensitivities should be aware that potatoes, like other members of the nightshade family, can cause allergic reactions in some individuals.',0,0,0);
